export default function Secret() {
    function nada() {
        let text = document.getElementById("será?");
        text.value = "";
    }
    return(
        <div className="container">
            <h1>HELLO FRIEND.</h1>
            <input id="será?" type="password"/>
            <button onClick={nada}>Entrar</button>
        </div>
    )
}
